function Deck() {
    var cards = [];

    function addCards() {
        _.each(deckList, function (number, name) {
            for (var i=0; i<number; i++) {
                cards.push(new Card(cardDefinitions[name]));
            }
        });

        cards = _.shuffle(cards);
    }
    this.drawCard = function () {
        if (cards.length == 0) {
            addCards();
        }
        return cards.pop();
    };
    return this;
}

var deckList = {
    coffee: 4,
    bottle: 2,
    chewer: 2
};

var cardDefinitions = {
    "coffee": {
        "name": "Coffee Beans",
        "imageData": "data:image/jpeg;base64,"
    },
    "bottle": {
        "name": "Bottle",
        imageData: "data:image/jpeg;base64,"
    },
    "chewer": {
        name: "Goblin Chewer",
        imageData: "data:image/jpeg;base64,"
    }
};